import React, { useEffect, useState } from "react";
import {deleteProductListing} from "../../Services/ProductListingService.js";
export default function ProductListingsListItem(props){

    const [deleteMsg, setDeleteMsg] = useState([]);

    useEffect(() => {
        deleteProductListing().then((deleteMsg) => {
            setDeleteMsg(deleteMsg);
        });
        console.log(deleteMsg);
    }, []);

    return (
        <div>
            {props.sellerName} is selling their {props.productName} for ${props.price}.
            &nbsp;<button>Delete this listing</button>
        </div>
    )
}
